import actions from "./actions";
import axios from "axios";

const {
    championBegin,
    championSuccess,
    championErr,
} = actions;

const getChampions = () => {
    return async (dispatch) => {
        try {
            await dispatch(championBegin());
            const champion = await axios.get(
                process.env.REACT_APP_RESTAPI_HOST+"장나나냐?api_key=RGAPI-914fd54f-3b53-45da-b4be-b8e0a2e1a2a3"
            );
            console.log(champion);
            await dispatch(championSuccess(champion.data));
        } catch (err) {
            await dispatch(championErr(err));
        }
    };
}

export {getChampions};
